ter at have overvåget en del karavaner og set vagter beskytte dem besluttede han at han også kunne klare det job, og at det ville give ham en chance for at komme ud i verdenen.\\nSom lejesvend/vagt lærte han våbenkunst og klarede sig godt ved at vide hvordan man undgår at blive overvåget og forfulgt.\\n\\nFor nyligt har han besluttet sig for at det er irrelevant at være vagt for han kan kun beskytte ting så længe han er der, og så snart han er væk kan alting gå galt alligevel. Uanset hvor mange banditter han slår ihjel kommer der bare flere så længe lederen som sidder hjemme i skjulet stadig er i live. \\nDerfor har han besluttet sig for at vende tilbage til sine evner som spion/agent og forhåbentligt gøre en forskel ved at gå efter mere strategiske mål som har indflydelse. Folk som korrupte politikere, bandit ledere og deslige\\n\\nSit kaldenavn \\logseq____&quot;[[Lark]]\\logseq____&quot; fik han som barn som kodenavn hos sin kontakt fordi han var god til at imitere fuglelyde/sang og holdt til i skovenlogseq____&quot;,536871004]],[logseq____&quot;^15logseq____&quot;,[1100,logseq____&quot;^Ologseq____&quot;,logseq____&quot;^16logseq____&quot;,536871004]],[logseq____&quot;^15logseq____&quot;,[1100,logseq____&quot;^Flogseq____&quot;,1097,536871004]],[logseq____&quot;^15logseq____&quot;,[1100,logseq____&quot;^Xlogseq____&quot;,26,536871004]],[logseq____&quot;^15logseq____&quot;,[1100,logseq____&quot;^Vlogseq____&quot;,26,536871004]],[logseq____&quot;^15logseq____&quot;,[1100,logseq____&quot;^Ulogseq____&quot;,26,536871004]],[logseq____&quot;^15logseq____&quot;,[1100,logseq____&quot;^?logseq____&quot;,[logseq____&quot;^ logseq____&quot;,logseq____&quot;^3Clogseq____&quot;,3],536871004]],[logseq____&quot;^15logseq____&quot;,[1100,logseq____&quot;^Jlogseq____&quot;,[],536871004]],[logseq____&quot;^15logseq____&quot;,[1100,logseq____&quot;^Hlogseq____&quot;,26,536871004]],[logseq____&quot;^15logseq____&quot;,[1100,logseq____&quot;^;logseq____&quot;,logseq____&quot;~u66181       // This script checks to see if a redirect is present in the query string
      // and converts it back into the correct url and adds it to the
      // browser's history using window.history.replaceState(...),
      // which won't cause the browser to attempt to load the new url.
      // When the single page app is loaded further down in this file,
      // the correct url will be waiting in the browser's history for
      // the single page app to route accordingly.
      (function(l) {
        if (l.search) {
          var q = {};
          l.search.slice(1).split('&').forEach(function(v) {
            var a = v.split('=');
            q[a[0]] = a.slice(1).join('=').replace(/~and~/g, '&');
          });
          if (q.p !== undefined) {
            window.history.replaceState(null, null,
              l.pathname.slice(0, -1) + (q.p || '') +
              (q.q ? ('?' + q.q) : '') +
              l.hash
            );
          }
        }
      }(window.location))</script>
